Legionnaires #17
Publisher:  DC Comics
Publication Date:  August 1994

Writers:  Mark Waid
Pencillers:  Chris Gardner
Inkers:  Dennis Cramer
Colorist:  Tom McCraw
Letterer:  Pat Brosseau
Cover:  Stuart Immonen and Tom McCraw

The Legionnaires continue to feel the effects of time anomalies, with new members joining and old members leaving. They are then attacked by a group of super villains from their past.  Story continues in Valor #22.

The cover is mislabeled &quot;Conclusion&quot; when it is actually a Zero Hour tie-in.

